svg.script:
			var svgElement = document.getElementById("temporal");
			svgElement.addEventListener("mouseover", hprint);
			svgElement.addEventListener("mouseout", nullprint);
			
			var svgElement = document.getElementById("parietal");
			svgElement.addEventListener("mouseover", parprint);
			svgElement.addEventListener("mouseout", nullprint);
			
			var svgElement = document.getElementById("frontal");
			svgElement.addEventListener("mouseover", froprint);
			svgElement.addEventListener("mouseout", nullprint);
			
			var svgElement = document.getElementById("occipital");
			svgElement.addEventListener("mouseover", occprint);
			svgElement.addEventListener("mouseout", nullprint);

			function hprint() {
				document.getElementById("demo").innerHTML = "Temporal lobe";
			}
			
			function parprint() {
				document.getElementById("demo").innerHTML = "Parietal lobe";
			}
			
			function froprint() {
				document.getElementById("demo").innerHTML = "Frontal lobe";
			}
			
			function occprint() {
				document.getElementById("demo").innerHTML = "Occipital lobe";
			}
			
			function nullprint() {
				document.getElementById("demo").innerHTML = "";
			}
